function transIdToStampSingle(marker = '') {
    if(/^\d+_\d+$/gui.test(marker)) {
        // stamp
        return marker;
    } else if(/^\d+$/gui.test(marker)) {
        // id
        var markerStamp = TRANS_ID_TO_STAMP[marker] || '';
        return markerStamp;
    }
    return '';
}

function transIdToStamp(list = []) {
    var stampObj = {};

    for(var i = 0; i < list.length; i++) {
        var marker = list[i] || '';
        var markerStamp = transIdToStampSingle(marker);

        if(markerStamp) {
            stampObj[markerStamp] = true;
        }
    }
    return Object.keys(stampObj);
}

function transStampToIdSingle(marker = '') {
    if(/^\d+_\d+$/gui.test(marker)) {
        // stamp
        var markerId = TRANS_STAMP_TO_ID[marker] || '';
        return markerId;
    } else if(/^\d+$/gui.test(marker)) {
        // id
        return marker;
    }
    return '';
}

function transStampToId(list = []) {
    var idObj = {};

    for(var i = 0; i < list.length; i++) {
        var marker = list[i] || '';
        var markerId = transStampToIdSingle(marker);

        if(markerId) {
            idObj[markerId] = true;
        }
    }
    return Object.keys(idObj);
}
